import React from 'react';
import './css/Home.css'
import { Grid, Card, Paper} from '@material-ui/core';
import RegionesChile from '../components/ContainerHome'


export default function Home(){
        return (
            <>  
                <Grid container>
                    <Card className='main1'>
                            <h1 className='paper_prim'>Propiedades por Regiones</h1>
                            <RegionesChile/>
                       
                    </Card>
                    <Card className='main2'>
                        <h1 className='paper_prim'>Propiedades</h1>
                    </Card>
                   </Grid>
                
            </>
        )
}
